import 'react-native-gesture-handler';
import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import FriendScreen from './component/FriendScreen.js';
import HomeScreen from './component/HomeScreen.js';
import SettingScreen from './component/SettingScreen.js';
import BudgetScreen from "./component/BudgetScreen.js";
import CurrencyScreen from "./CurrencyScreen.js";
import CategoryScreen from "./CategoryScreen.js";

const Tab = createBottomTabNavigator();
const Stack = createStackNavigator();
export default function App() {
  return (
    <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen name="Home" component={HomeScreen} />
        <Tab.Screen name="Friend" component={FriendScreen} />
        <Tab.Screen name="Setting" component={SettingScreen} />
      </Tab.Navigator>
            <Stack.Navigator initialRouteName="Setting">
            <Stack.Screen name="Budget" component={BudgetScreen} />
            <Stack.Screen name="Currency" component={CurrencyScreen}/>
            <Stack.Screen name="Category" component={CategoryScreen}/>
            </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
